import Home from "./components/Home";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="w-screen justify-center flex py-8">
      <div className="max-w-[1024px] w-full">
        <div className="fixed w-full">
          <Navbar />
        </div>
        <Home />
      </div>
    </div>
  );
}

export default App;
